<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<style>
  .click, button, #header { cursor: pointer; }
  .small { font-size: 12px; font-weight: bold; }
  .highlight { background-color: yellow; }
  body { font-family: 'Arial'; background-color: lightcyan; }
  table { width: auto; border-collapse: collapse; }
  th, td { border: 1px solid lightgray; padding: 4px; text-align: left; }
  th, .button { font-weight: bold; background-color: black; color: lightcyan; }
  #filters { width: 100%; }
</style>
<script>
  function getEle (id) { return document.getElementById(id) }
  function getVal (id) { return getEle(id).value }
  function setHTML (id, val) { getEle(id).innerHTML = val }
  function getDisp (id) { return getEle(id).style.display }
  function setDisp (id, val) { getEle(id).style.display = val }
  function fs(code) { window.open('https://www.familysearch.org/tree/person/' + code, '_blank') }
  function button (header, cell, content, func, arg) {
    cell.innerHTML = content
    cell.classList.add('click')
    if (header) {
      cell.classList.add('button')
      cell.onclick = function() { func() }
    }
    else cell.onclick = function() { func(arg) }
  }
  function highlight(table) {
      table.classList.add('highlight')
      setTimeout(function() { table.classList.remove('highlight') }, 2000)
  }
  function popup(index) {
    const chains = tree[index][6].split(',')
    const name = tree[index][1]
    const width = 350; const height = 200
    const left = (screen.width / 2) - (width / 2); const top = (screen.height / 2) - (height / 2)
    const popup = window.open('', 'chains', `width=${width},height=${height},scrollbars=yes,toolbar=no,menubar=no,location=no,status=no,left=${left},top=${top}`)
    popup.document.write(`<html><head><title>${name}</title></head><body>`)
    chains.forEach(chain => { popup.document.write(`<div>${chain}</div>`) });
    popup.document.write('</body></html>')
    popup.document.close()
  }
  function copy() {
    const table = document.getElementById('ancestors');
    const range = document.createRange()
    range.selectNode(table)
    window.getSelection().removeAllRanges()
    window.getSelection().addRange(range)
    if (document.execCommand('copy')) { highlight(table) }
    window.getSelection().removeAllRanges()
  }
  function dump() {
    const table = document.getElementById('ancestors')
    const rows = table.querySelectorAll('tr')
    let csv = ''
    rows.forEach((row, index) => {
      if (index === 0) return
      if (row.offsetParent !== null) { // Check if the row is visible
        csv += tree[index - 1].map(col => '"' + col.replace(/"/g, '""') + '"').join(',') + '\n'
      }
    })
    const blob = new Blob([csv], { type: 'text/csv' })
    const link = document.createElement('a')
    link.href = URL.createObjectURL(blob)
    link.download = 'ancestors.csv'
    document.body.appendChild(link)
    link.click()
    document.body.removeChild(link)
  }
  async function search() {
    setHTML('counter', 'Searching...')
    await new Promise((resolve) => setTimeout(resolve, 500))
    function escPeriods(f) { return f.replace(/\./g, '\.') }
    function hasSpace(f) { return(f ? f.replace(/^\s/, `(^|\\(|\\s)`).replace(/\s$/, `(\\s|,|-|;|\\)|$)`) : '') }
    function makeYear(f) { return(f ? f.replace(/\d+/g, m => m.length > 4 ? m.slice(0, 4) : m + '\\d'.repeat(4 - m.length)) : '') }
    function match(p, txt) { return p.test(txt) }
    const patternName = new RegExp(escPeriods(hasSpace(getVal('filterName'))), 'i')
    const patternPlace = new RegExp(escPeriods(hasSpace(getVal('filterPlace'))), 'i')
    const patternYear = new RegExp(escPeriods(makeYear(getVal('filterYear'))), 'i')
    const tr = getEle('ancestors').getElementsByTagName('tr')
    let count = 0
    for (let i = 0; i < tree.length; i++) {
      if (
        match(patternName, tree[i][1]) &&
        (match(patternPlace, tree[i][3]) || match(patternPlace, tree[i][5])) &&
        (match(patternYear, tree[i][2]) || match(patternYear, tree[i][4]))
      ) {
        tr[i + 1].style.display = ''
        ++count
      }
      else tr[i + 1].style.display = 'none'
    }
    setHTML('counter', count)
  }
  function filterTable() {
    if (getVal('filterName').length + getVal('filterPlace').length + getVal('filterYear').length < 4) {
      setHTML('counter', "<button onclick='search()'>Search</button>")
      return
    }
    search()
  }
  function toggle() {
    if (getDisp('instructions') === "none") {
      setHTML('header', "Instructions ▲")
      setDisp('instructions', "")
    }
    else {
      setDisp('instructions', "none")
      setHTML('header', "Instructions ▼")
    }
  }
  function buildIntro() {
    setHTML('heading', tree[0][1] + " and 30 generations of ancestors. " + tree.length + " records found on <a href='https://www.familysearch.org' target='_blank'>FamilySearch.org</a> April 3-4, 2025.")
    setHTML('header', "Instructions ▲")
    setHTML("instructions",
     `<li>Click on the <i>Search</i> button when the search boxes are empty to make the entire table of ancestors visible. There may be a long delay.</li>
      <li>The <i>Search</i> button disappears when there are more than three characters in all three search boxes combined; the table is then updated immediately as additional keys are pressed.</li>
      <li>If a name or place to be searched for begins or ends with a space, matches must begin or end on a word boundary.</li>
      <li>Years are 4-digit numbers. Entering less than 4 digits matches that decade, century or millenium.</li>
      <li>Click on the ID to link to an ancestor's profile on FamilySearch.org. You must be signed in to view it.</li>
      <li>Click on <i>∞</i> to open a new window containing a list of relationship chains leading to the ancestor. There can be multiple chains leading to the same ancestor. F = Father, M = Mother.</li>
      <li>Click on <i>Dump</i> to dowload the table in CSV format, importable to a spreadsheet (UTF-8 encoding). Only visible table rows will be downloaded.</li>
      <li>Click on <i>Copy</i> to copy the visible table to the clipboard. If a very large table is copied, it may take a long time to paste unless pasted without formatting (text only).</li>
      <li>Hide these instructions by clicking on ▲ above.</li>`)
    setHTML('thead', '<tr><th>Name</th><th>ID</th><th>Birth date</th><th>Birth place</th><th>Death date</th><th>Death place</th><th>∞</th></tr>')
    const table = getEle('filters')
    const row = table.insertRow()
    row.insertCell(0).innerHTML = "<input type='text' id='filterName' onkeyup='filterTable()' placeholder='Search for names...'>"
    row.insertCell(1).innerHTML = "<input type='text' id='filterPlace' onkeyup='filterTable()' placeholder='Search for places...'>"
    row.insertCell(2).innerHTML = "<input type='text' id='filterYear' onkeyup='filterTable()' placeholder='Search for years...'>"
    const cell3 = row.insertCell(3)
    cell3.id = 'counter'
    cell3.style.width = '100%'
    button(true, row.insertCell(4), 'Dump', dump)
    button(true, row.insertCell(5), 'Copy', copy)
  }
  function buildTable() {
    getEle('ancestors').style.width = '100%'
    const table = getEle('tbody')
    tree.forEach((cell, index) => {
      const row = table.insertRow()
      row.style.display = 'none'
      row.insertCell(0).innerHTML = cell[1]
      button(false, row.insertCell(1), cell[0], fs, cell[0])
      row.insertCell(2).innerHTML = cell[2]
      row.insertCell(3).innerHTML = cell[3]
      row.insertCell(4).innerHTML = cell[4]
      row.insertCell(5).innerHTML = cell[5]
      button(false, row.insertCell(6), '∞', popup, index)
    })
  }
  function build() {
    buildIntro()
    buildTable()
    filterTable()
    document.title = tree[0][1]
  }

  document.title = 'Loading...'
  window.onload = build
</script>
